package com.sylar.leetcode.alg;

import org.junit.Assert;
import org.junit.Test;

public class StrTest {
    @Test
    public void test_001_SubSeq() {
        Assert.assertEquals(true, Str.isSubSeq("abc", "ajjthbedcctext"));
        Assert.assertEquals(true, Str.isSubSeqHash("abc", "ajjthbedcctext"));
        Assert.assertEquals(true, Str.isSubSeqDp("abc", "ajjthbedcctext"));
    }

    @Test
    public void test_002_SubSeq() {
        Assert.assertEquals(false, Str.isSubSeq("acb", "ahbgdc"));
        Assert.assertEquals(false, Str.isSubSeqHash("acb", "ahbgdc"));
        Assert.assertEquals(false, Str.isSubSeqDp("acb", "ahbgdc"));
    }

    @Test
    public void test_003_SubSeq() {
        Assert.assertEquals(true, Str.isSubSeq("leeeeetcode", ""));
        Assert.assertEquals(true, Str.isSubSeqHash("leeeeetcode", ""));
        Assert.assertEquals(true, Str.isSubSeqDp("leeeeetcode", ""));
    }

    @Test
    public void test_004_SubSeq() {
        Assert.assertEquals(false, Str.isSubSeq("axc", "ahbgdc"));
        Assert.assertEquals(false, Str.isSubSeqHash("axc", "ahbgdc"));
        Assert.assertEquals(false, Str.isSubSeqDp("axc", "ahbgdc"));
    }
}